import { signInAPI } from "../action.js";
import { auth, provider } from "../Firebase";

signInAPI = () => {
  auth
    .signInWithPopup(provider)
    .then((payload) => {
      console.log(payload);
    })
    .catch((error) => {
      console.log(error);
    });
};

export default signInAPI;
